import React,{useState} from 'react';
import Card from './component/Card';
import './App.css';

interface Person {
  name: string
  lastName: string
  age: number
  employed: boolean
  description?: string
}

const INITIAL_STATE: Person = {
  name: 'Harry',
  lastName: 'Barzola',
  age: 35,
  employed: true
}

function App() {

  const [person, setPerson] = useState <Person>(INITIAL_STATE)

  const handlePerson = () =>{
     setPerson({...person, age: 44})
  }
  return (
    <div className="App">
      <Card person={person} handlePerson={handlePerson}/>

    </div>
  );
}

export default App;
